    if (clubName == 'Vortex')
      return 'data:image/png;base64,';
    if (clubName == 'Probe')
      return 'data:image/jpeg;base64,';
    if (clubName == 'Currents')
      return 'data:image/jpeg;base64,';
    if (clubName == 'Sensors')
      return 'data:image/png;base64,';
    if (clubName == 'Synergy')
      return 'data:image/jpeg;base64,';
    if (clubName == 'Moments')
      return 'data:image/jpeg;base64,';
    if (clubName == 'Alchemy')
      return 'data:image/jpeg;base64,';
    if (clubName == 'Prodigy')
      return 'data:image/jpeg;base64,';
    if (clubName == 'Mettle')
      return 'data:image/png;base64,';
